import React from 'react';
import { Route } from 'react-router-dom';
import { useDispatch, useSelector } from 'react-redux';
import { LinkContainer } from 'react-router-bootstrap';
import { Navbar, Nav, Container, NavDropdown, Form, Row, Col } from 'react-bootstrap';
import SearchBox from './SearchBox';
import { logout } from '../actions/userActions';

const Header = () => {
  const dispatch = useDispatch();

  const userLogin = useSelector((state) => state.userLogin);
  const { userInfo } = userLogin;

  const logoutHandler = () => {
    dispatch(logout());
  };

  return (
    <header>
      {/* Phần đầu với Logo, Tìm Kiếm và Liên Kết */}
      <Navbar bg="light" variant="light" expand="lg" collapseOnSelect className="py-3">
        <Container>
          <Row className="align-items-center w-100">
            {/* Cột Bên Trái: Các Liên Kết */}
            <Col lg={3} md={4} sm={12} className="text-left">
              <Nav className="d-flex">
                <LinkContainer to="/cart">
                  <Nav.Link>
                    <i className="fas fa-shopping-cart"></i> Giỏ Hàng
                  </Nav.Link>
                </LinkContainer>
                <LinkContainer to="/contact">
                  <Nav.Link>Liên Hệ</Nav.Link>
                </LinkContainer>
              </Nav>
            </Col>

            {/* Cột Chính Giữa: Logo */}
            <Col lg={6} md={4} sm={12} className="text-center">
              <LinkContainer to="/">
                <Navbar.Brand>
                  <img
                    src="/assets/img/logo/logo.png"
                    alt="Cửa Hàng Điện Tử"
                    style={{ maxWidth: '200px' }}
                  />
                </Navbar.Brand>
              </LinkContainer>
            </Col>

            {/* Cột Bên Phải: User Info */}
            <Col lg={3} md={4} sm={12} className="text-right">
              <Nav>
                {userInfo ? (
                  <NavDropdown title={userInfo.name} id="username">
                    <LinkContainer to="/profile">
                      <NavDropdown.Item>Thông Tin Của Tôi</NavDropdown.Item>
                    </LinkContainer>
                    <NavDropdown.Item onClick={logoutHandler}>Đăng Xuất</NavDropdown.Item>
                  </NavDropdown>
                ) : (
                  <LinkContainer to="/login">
                    <Nav.Link>
                      <i className="fas fa-user"></i> Đăng Nhập
                    </Nav.Link>
                  </LinkContainer>
                )}
                {userInfo && userInfo.isAdmin && (
                  <NavDropdown title="Admin" id="adminmenu">
                    <LinkContainer to="/admin/userlist">
                      <NavDropdown.Item>Người Dùng</NavDropdown.Item>
                    </LinkContainer>
                    <LinkContainer to="/admin/productlist">
                      <NavDropdown.Item>Các Sản Phẩm</NavDropdown.Item>
                    </LinkContainer>
                    <LinkContainer to="/admin/orderlist">
                      <NavDropdown.Item>Đơn Hàng</NavDropdown.Item>
                    </LinkContainer>
                  </NavDropdown>
                )}
                <LinkContainer to="/about">
                  <Nav.Link>Về Chúng Tôi</Nav.Link>
                </LinkContainer>
              </Nav>
            </Col>
          </Row>
        </Container>
      </Navbar>

      {/* Thanh tìm kiếm */}
      <Container className="py-3">
        <Row>
          <Col lg={8} md={10} sm={12} className="mx-auto">
            <Route render={({ history }) => <SearchBox history={history} />} />
          </Col>
        </Row>
      </Container>
    </header>
  );
};

export default Header;
